import React from "react";

const Biographie = () => {
    document.querySelector("Biographie").return(
        <div className="Biographie modules">
            <div className="marquee">
                <h2>Je suis un développeur de qualité qualitatif ✓</h2>
                <h2>J'apprends plus vite que mon ombre ✓</h2>
                <h2>Je suis passionné ✓</h2>
                <h2>Je suis motivé ✓</h2>
                <h2>Je ne pratique pas le krav maga ✕</h2>
            </div>
        </div>
    );
};

export default Biographie;
